import math

class Solution(object):
    def superpalindromesInRange(self, L, R):
        L, R = int(L), int(R)
        MAGIC = 100000
        ans = 0

        # 奇數長度回文
        for k in range(1, MAGIC):
            s = str(k)
            t = s + s[-2::-1]
            v = int(t) ** 2
            if v > R:
                break
            if v >= L and str(v) == str(v)[::-1]:
                ans += 1

        # 偶數長度回文
        for k in range(1, MAGIC):
            s = str(k)
            t = s + s[::-1]
            v = int(t) ** 2
            if v > R:
                break
            if v >= L and str(v) == str(v)[::-1]:
                ans += 1

        return ans
